        if lis[i + 1] >= 1:
            lis[i + 1] -= 1
            lis[i] += 2
            return 1
        else:
            ret = move(i + 1)
            lis[i + 1] -= 1
            lis[i] += 2
            return ret + 0
    dic = {}
    rdic = {}
    for i in range(61):
        dic[2 ** i] = i
        rdic[i] = 2 ** i
    if sum(boxes) < n:
        return -1
    lis = [0] * 62
    ans = 0
    for i in boxes:
        lis[dic[i]] += 1
    nsum = 0
    NN = 0
    for i in range(61):
        nsum += lis[i] * rdic[i]
        NN += n & rdic[i]
        if nsum >= NN:
            continue
        else:
            ans += move(i)
            nsum += rdic[i]
    return ans

